VALUES ('2600263014042', 'choco mix', 'Mélange de fruits secs (amande, arachide, noisette, raisin) enrobés aux 3 chocolats. Ingrédients fruits secs (AMANDE, ARACHIDE, NOISETTE, raisin), chocolat noir (pâte de cacao, sucre, beurre de cacao, matière grasse LAITIERE anhydre, émulsifiant ldcithine de SOJA, arame naturel vanille), chocolat au lait (sucre, baurre da cacao, LAIT entier en poudre, pâte de cacao, émulsifiant lécithine de SOJA, arôme naturel vanille chocolat blanc (sucre, LAIT entier en poudra. baurru da cacao, émulsifiant lécithine de JA, arma natural vanille), huiles végétales (tournesel, neix de coco), amidon modifié de tapioca, sirop de glucose, agent d\'anrobage E904, émulsifiant E471, acidifiant E330, conservateur E202. En proportions variables. Chocolat noir : cacao : 50% minimum Chocolat au lait cacao : 30% minimum Chocolat blanc cacao : 22% minimum. Traces possibles de gluten et de sésame. Fabriqué en Hollande. 131 - S .a1', 'https://static.openfoodfacts.org/images/products/260/026/301/4042/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

