VALUES ('26004242', 'Sushi box', 'sushi : 79% riz préparé (riz cuit (eau, riz, huile de tournesol), Sirop de fructose-glucose, vinaigre d\'alcool, sel, de riz, correcteur d\'acidité : acétate de sodium), 7,7% saumon cru (poisson), nori (algue sechee), 2,8% saumon cuit (poisson) poivron vert, mayonnaise (huile de colza, Jaune d œuf, eau, vinaigre d\'alcool, graines de moutarde, sucre, sel, épices), sesame concombre, f,-omage frais (lait, creme (lait), ferments lactiques, présure, sel), sauce aigre-douce (eau, sucre, sirop de glucose, ju concentré d\'ananas, puree de tomates, amidon de mais modifié, acidifiant : acide acetique ; sel, colorant : extrait de paprik carotine; stabilisant : xanthane (soja,blé)), flocons de piment rouge, sel, poudre de paprika, aneth. Accompagnements : Sauce soj (eau, soja, blé, sel, alcool (ethanol)), preparation à base de gingembre (6396 gingembre, fructose, sirop de glucose, sel, acidifiant acide acetique, acide citrique), preparation à base de wasabi (eau, poudre de raifort, moutarde, poudre de wasabi, complexe cuivre chlorophylle et chlorophylline, curcumine). Traces éventuelles de crustacés. A conserver entre OCC et +20C maximum.', 'https://static.openfoodfacts.org/images/products/26004242/front_fr.4.400.jpg', '8.5', '1.7', '24', '6.6', '', '5.5', '1.9', '0.748031496062992', '', '0');

